import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  IconButton,
  InputBase,
  Menu,
  MenuItem,
  Box,
  Tooltip,
} from '@mui/material';
import {
  ShoppingCart,
  Favorite,
  Search,
  AccountCircle,
  KeyboardArrowDown,
} from '@mui/icons-material';

const kategoriler = [
  { ad: 'Ana Sınıfı Kitapları', path: '/kategori/ana-sinif' },
  { ad: 'İlk Okul Kitapları', path: '/kategori/ilkokul' },
  { ad: 'Okul Öncesi Kitapları', path: '/kategori/okul-oncesi' },
  { ad: 'Orta Okul Kitapları', path: '/kategori/ortaokul' },
  { ad: 'Hobi Oyunları', path: '/kategori/hobi-oyunlari' },
  { ad: 'Okuma Kitapları', path: '/kategori/okuma-kitaplari' },
  { ad: 'Deneme Sınavları', path: '/kategori/deneme-sinavlari' },
  { ad: 'Sözlükler ve Ansiklopediler', path: '/kategori/sozlukler-ansiklopedi' },
];

const Header = () => {
  const [kategoriMenuAnchor, setKategoriMenuAnchor] = useState(null);
  const navigate = useNavigate();

  const handleKategoriMenuOpen = (event) => {
    setKategoriMenuAnchor(event.currentTarget);
  };

  const handleKategoriMenuClose = () => {
    setKategoriMenuAnchor(null);
  };

  return (
    <AppBar position="static">
      <Toolbar>
        <Typography
          variant="h6"
          component={Link}
          to="/"
          sx={{ textDecoration: 'none', color: 'inherit', marginRight: 2 }}
        >
          Doruk Kitap
        </Typography>

        <Box sx={{ flexGrow: 1, display: 'flex', alignItems: 'center' }}>
          <Button
            color="inherit"
            onClick={handleKategoriMenuOpen}
            endIcon={<KeyboardArrowDown />}
          >
            Kategoriler
          </Button>
          <Menu
            anchorEl={kategoriMenuAnchor}
            open={Boolean(kategoriMenuAnchor)}
            onClose={handleKategoriMenuClose}
            MenuListProps={{
              'aria-labelledby': 'kategori-menu',
            }}
          >
            {kategoriler.map((kategori) => (
              <MenuItem
                key={kategori.path}
                component={Link}
                to={kategori.path}
                onClick={handleKategoriMenuClose}
              >
                {kategori.ad}
              </MenuItem>
            ))}
          </Menu>
          <Box sx={{ position: 'relative', marginLeft: 2, display: 'flex', alignItems: 'center' }}>
            <Search />
            <InputBase
              placeholder="Kitap, yazar veya yayınevi ara..."
              sx={{ ml: 1, width: '300px' }}
            />
          </Box>
        </Box>

        <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
          <Tooltip title="Favorilerim">
            <IconButton color="inherit" onClick={() => navigate('/favorilerim')}>
              <Favorite />
            </IconButton>
          </Tooltip>
          <Tooltip title="Sepetim">
            <IconButton color="inherit" onClick={() => navigate('/sepetim')}>
              <ShoppingCart />
            </IconButton>
          </Tooltip>
          <Tooltip title="Hesabım">
            <IconButton color="inherit" onClick={() => navigate('/hesabim')}>
              <AccountCircle />
            </IconButton>
          </Tooltip>
          <Button color="inherit" onClick={() => navigate('/giris')}>Giriş Yap</Button>
          <Button color="inherit" onClick={() => navigate('/kayit')}>Üye Ol</Button>
        </Box>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
